    font-size: 20px;
    line-height: 40px;
    font-weight: 550;
    transition: transform 0.5s;
    color: $green-color;
    -webkit-text-stroke: 0.7px $black-color;

    &:hover {
      color: $orange-color;
    }
  }

  &__toggler-label {
    display: none;
    margin: 35px;
    width: 20px;
    height: 20px;
    color: $black-color;
    cursor: pointer;

    &::before {
      content: url(../images/Menu.png);
