    width: 48px;
    height: 48px;
    margin: 0 5px;
    border-radius: 100%;
    background: rgba(255, 255, 255, 0.7);

    &:first-child {
      transform: rotate(180deg);
    }
  }

  @media (min-width: $medium-screen) {
    display: grid;

    &__top {
      display: grid;
      grid-column-gap: 20px;
      grid-template-columns: repeat(2, 1fr);
    }

    &__img:nth-child(3) {
      display: block;
      height: 100%;
    }

    &__btn {
      margin: 0 20px;
    }
