  @media (min-width: 1280px) {
    grid-row-gap: 30px;

    &__img,
    &__button {
      display: block;
    }

    &__img:nth-child(3),
    &__navigation-area,
    &__option {
      display: none;
    }

    &__img:nth-child(2) {
      height: 100%;
    }

    &__top {
      grid-template-columns: 1fr 2fr;
      grid-column-gap: 30px;
    }

    &__bottom {
      display: grid;
      grid-template-columns: 2fr 1fr;
      grid-column-gap: 30px;
    }
